import React, { Component } from "react";
const numbers = [1, 2, 3, 4, 5];
export default class Board extends Component {
  listItems = numbers.map((number) => <li>{number}</li>);
  constructor(props) {
    super();
  }
  componentDidMount = () => {};

  render() {
    return (
      <React.Fragment>
        <div>
          {<Card></Card>}
        </div>
      </React.Fragment>
    );
  }
}
